/* tslint:disable */
// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmHls,
  VmFile,
  VmVideo 
} from '@vime/core';

import { define } from '../lib';


define('vm-hls', VmHls);
define('vm-file', VmFile);
define('vm-video', VmVideo);


export interface HlsProps extends JSX.VmHls, HTMLAttributes<HTMLVmHlsElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmHlsElement, HlsProps>(
  'vm-hls',
  new Set(['version','libSrc','config','crossOrigin','preload','poster','controlsList','autoPiP','disablePiP','disableRemotePlayback','playbackReady','mediaTitle']),
);
